Method.Implementation:
set id = %UDF.Id
//Taken from UDF entry: $$OnAfterSave^UAUXXMRProcedures(id) - Event: OnAfterSave
Quit $$OnAfterSave^UAUXXMRProcedures(id)

set sc = $$$OK
Try {
	set sc = ..RegisterWithFeature("User.MRProcedures", "OnAfterSave","##class(Custom.AUSW.Feature.MRProcedures).OnAfterSave()", $$$Feature(AUSWMRProceduresOnAfterSave))
	If $System.Status.IsError(sc) Quit
} catch(ex){
